INSERT INTO `referee` (`name`, `bio`, `id`) VALUES
('Andre Marriner', 'Having worked within the Football League for five years from 2000, Andre Marriner was appointed as a Select Group referee in 2005 and has officiated in the Premier League ever since.\n\nMarriner was a Football League assistant referee for three years before being promoted to the position of referee in 2003.\n\nHis first Premier League appointment was in November 2004, when Charlton Athletic defeated Norwich City, and he was added to the Select Group for the following season.\n\nIn 2008, Marriner was the fourth official for Manchester United’s FA Community Shield success over Portsmouth and he was invited to join the FIFA list of referees for the following year, leading him to officiate in World Cup and European Championship qualifiers, as well as Europa League fixtures.\n\nMarriner returned to the FA Community Shield fixture in 2010, this time as referee, and he was also in charge of Blackpool’s Championship Play-off Final victory over Cardiff City in 2011.\n\nA return to Wembley Stadium happened two years later as the Birmingham FA referee was in the middle for Wigan Athletic\'s FA Cup final triumph over Manchester City.\n', 6),
('Andy Taylor', '', 20),
('Anthony Taylor', 'Anthony Taylor has been a member of the Select Group of referees since the 2010/11 season, after an eight-year career officiating non-league and Football League matches.\n\nTaylor started refereeing in the North Premier League from 2002 to 2004 before being given a chance to take control of Conference matches.\n\nIt took only two years to gain a further promotion and officiate in the Football League for the first time.\n\nIn his fourth season of refereeing in the Football League, Taylor was given his first opportunity to work in the top-flight when taking charge of Fulham’s 1-0 win over Portsmouth in February 2010.\n\nLater that year, Taylor was in charge for the FA Vase final and his performances throughout the 2009/10 campaign elevated the Cheshire FA referee to the Select Group officials for the following season.\n\nThe FA Trophy final followed in 2012, before Taylor was the fourth official in Wigan Athletic\'s 1-0 victory over Manchester City in the 2013 FA Cup final. \n\nBy this time, Taylor was promoted to the FIFA officials list and in 2015 he would referee the Capital One Cup Final between Chelsea and Tottenham Hotspur, before returning to Wembley for Arsenal\'s 2015 Community Shield triumph over Chelsea.\n', 3),
('Chris Kavanagh', '', 19),
('Craig Pawson', 'Craig Pawson made his Premier League debut when he was in charge of Swansea City\'s clash with Newcastle United on 2 March 2013.\n\nPawson has been a referee since 1993, working his way up the Football League ladder since the 2008/09 campaign.\n\nThe Sheffield & Hallamshire FA referee was then placed in the Select Group of Premier League officials from the 2013/14 season.\n\nPrior to his promotion, the Yorkshire-based official took charge of more than 40 Championship matches and the 2012 League Two Play-Off Final, which saw Crewe Alexandra beat Cheltenham Town 2-0 at Wembley.\n\nPawson was also in the middle for the all-Premier League match-up between West Ham United and Wigan Athletic in the League Cup during the 2012/13 campaign.\n\nIn 2015, Pawson became the seventh referee from England to be selected on the FIFA International Referee List, allowing him to officiate in UEFA Champions League, UEFA Europa League and international fixtures.\n\nThe Yorkshireman was the fourth official for the 2015 League Cup Final between Chelsea and Tottenham Hotspur and then fulfilled the same position for Arsenal\'s FA Cup Final victory over Aston Villa later in the year.', 9),
('Graham Scott', 'Graham Scott officiated his first Premier League match on Saturday 29 November 2014 for the 1-1 draw between Burnley and Aston Villa at Turf Moor.\n\nThe Oxfordshire-born referee officiated non-league and FA Cup First Round matches from 2006/07 before joining the National List of referees at the beginning 2008/09 season.\n\nScott was the man in the middle when then Premier League team Bolton Wanderers were shocked by Crawley Town in the 2012/13 League Cup.\n\nThe Berks & Bucks FA official has also refereed cup fixtures at Stamford Bridge, home of Chelsea, and Southampton\'s St. Mary\'s Stadium in recent seasons.\n\nAhead of the 2015/16 Premier League season, Scott was promoted into the Select Group of referees.', 17),
('Jonathan Moss', 'Jonathan Moss qualified as a referee in 1988 and made his first big strides as an official 11 years later, working his way up the Football League pyramid to the Select Group of referees in 2011.\n\nMoss was an official in the Northern Counties and Northern Premier League between 1999 and 2005.\n\nHe was subsequently promoted to the Football League as an assistant referee and was in that role for two years before becoming a referee in 2005.\n\nThe West Riding FA official was appointed for his first Premier League match in December 2010, but the fixture between Wigan Athletic and Aston Villa was postponed.\n\nHowever, he did make his top-flight debut soon after in January 2011, when he oversaw Birmingham City’s 2-1 victory over Blackpool.\n\nThe following season, he was promoted to the list of Select Group referees, along with fellow Premier League official Neil Swarbrick.\n\nMoss\' most high-profile match came in May 2015 as he officiated Arsenal\'s 2015 FA Cup Final victory over Aston Villa.\n', 5),
('Kevin Friend', 'Leicester-based Kevin Friend has been a member of the Select Group of referees since the 2009/10 season, after a successful career outside of the top-flight.\n\nFriend took up refereeing as a 14-year-old and plied his trade in local football and Midlands leagues before he started to progress through the Football League pyramid.\n\nPrior to his appearance in the Premier League, he was regularly officiating in the Championship and has refereed over 100 matches to date, including the first leg of the Play-off Semi-final between Watford and Hull City in 2008.\n\nAlongside numerous high profile Premier League appointments, Friend’s most notable honours so far include the 2012 FA Community Shield between Manchester City and Chelsea and the 2013 Capital One Cup final between Swansea City and Bradford City.', 11),
('Lee Mason', 'Having been appointed as an assistant referee in the Premier League from 2000 to 2002, Lee Mason was given the opportunity to referee in the top-flight four years later, and he has maintained his position as a Select Group referee ever since.\n\nMason officiated in the North West Counties League for eight years before getting on to the Football League ladder for the first time.\n\nA couple of years as an assistant in the Football League were followed by a further two seasons in the same role for Premier League fixtures.\n\nMason was appointed as a Football League referee in 2002 and took charge of the 2006 League 1 Play-off Final between Barnsley and Swansea City before making the step up to the Premier League in the same year.\n\nThe Lancashire FA official refereed the 2009 FA Youth Cup Final between Arsenal and Liverpool, while later that year Mason was appointed fourth official for the FA Community Shield between Chelsea and Manchester United.\n\nMason was in the same role for the 2010 League Cup Final and Championship Play-off Final in 2011, with the Bolton-born official making the step into European domestic competitions as an additional assistant referee in the same year.\n\nThe Championship Play-off Final beckoned for Mason again in 2014, but this time he was the referee for the match between Queens Park Rangers and Derby County.', 13),
('Lee Probert', '', 18),
('Mark Clattenburg', 'Durham-born Mark Clattenburg has enjoyed a successful career on the national and international stage since he first took charge of a Football League match as a 25-year-old in 2000.\n\nThe former electrician was in the middle for Chesterfield Town’s clash with York City on that day and rapidly progressed up the career ladder before being promoted to the Select Group of referees in 2004. He has since regularly featured in the Premier League and was rewarded by being appointed to the FIFA list in 2006.\n\nClattenburg’s career started to flourish on the international stage as he took charge of a UEFA Under-17s Championship qualifier before refereeing his first UEFA Champions League match in August 2008. He subsequently progressed to be a FIFA Elite referee and has gone on to officiate Euro 2012 qualifiers and be an additional assistant referee at Euro 2012 in a team led by then fellow Select Group referee Howard Webb.\n\nAt the London 2012 Olympic Games, Clattenburg was in charge of the men’s gold medal match between Brazil and Mexico, at Wembley Stadium. He was the only English referee in the men’s football tournament.\n\nClattenburg is considered one of the top officials in English football and he was the man in the middle of Liverpool’s victory over Cardiff City in the 2012 League Cup Final at Wembley.\n\nThe Durham FA official returned to the national stadium foir the 2013 Community Shield, before he was awarded the 2016 FA Cup Final between Manchester United and Crystal Palace.\n\nA week after the FA Cup Final, Clattenburg refereed the UEFA Champions League final between Real Madrid and Atletico Madrid, in Milan.\n\nTaking charge of the UEFA Euro 2016 final between France and Portgual capped an impressive 2016 for Clattenburg, who was named the best referee of the year at the Globe Soccer Awards in December.', 8),
('Martin Atkinson', 'Martin Atkinson began his professional refereeing career at just 16 years of age and has risen through the ranks to become one of the most well respected officials in the Premier League.\n\nAfter starting in local leagues, he advanced to the Football League’s list of assistant referees in 1998. Promotions quickly followed and he was refereeing Conference matches by 2002.\n\nAtkinson had been an assistant referee in the Premier League between 2000 and 2003, but his first taste of refereeing in the top-flight came when he was in the middle for Manchester City’s clash at Crystal Palace in the 2004/05 season.\n\nHe has been a permanent fixture in the Premier League ever since and, after refereeing the 2006 FA Community Shield and 2008 FA Trophy Final, his most notable moment in English football came when he took charge of the 2011 FA Cup Final between Man City and Stoke City.\n\nThe 2013 Championship Play-off Final between Crystal Palace and Watford was referred by Atkinson and he also officiated Man City\'s Capital One Cup Final triumph over Sunderland in 2014.\n\nAtkinson has been a FIFA-listed official since 2006 and is one of a handful of Select Group referees who is an Elite FIFA referee. He has also officiated Champions League matches as well as fixtures at Euro 2012, where he teamed up with fellow Select Group referee at the time, Howard Webb.\n', 7),
('Michael Oliver', 'At only 25 years of age, Michael Oliver became the youngest referee in Premier League history when he took charge of Birmingham City’s clash with Blackburn Rovers in August 2010, and he has remained a top-flight official ever since.\n\nOliver’s rapid rise up the Football League ladder culminated in him being added to the Select Group of referees for the 2010/11 season.\n\nPrior to his time in the Premier League, Oliver was a Football League referee for three years after learning his trade through four years at non-league level.\n\nIn 2012, his quick progress was rewarded as he was elevated to the FIFA list of referees, making him eligible to take charge of fixtures in the UEFA Champions League and Europa League, as well as international matches.\n\nOliver, whose father Clive was a former Football League referee, was in charge of the 2014 Community Shield match between Manchester City and Arsenal at Wembley.\n\nHe was the man in the middle at Wembley again in 2016 when he officiated Man City\'s penalty shootout victory over Liverpool in the League Cup final.\n', 1),
('Mike Dean', 'Mike Dean has consistently officiated at the top level of English football since being appointed to the Select Group of referees in 2000. The referee has gone on to officiate a number of crucial league and cup matches since.\n\nDean’s first steps on to the Football League ladder came in 1995 as an assistant referee. He was promoted to the full referees’ list two years later and went on to officiate in the top flight of English football at the turn of the millennium.\n\nIn 2003, Dean was promoted to the FIFA list and took control of the FA Community Shield between Arsenal and Manchester United a year later. A Championship Play-off Final followed in 2006 and he was in the middle for his first FA Cup Final in 2008, when Portsmouth defeated Cardiff City at Wembley Stadium. He also officiated Birmingham City’s League Cup triumph over Arsenal in 2011.\n\nSince his promotion to the FIFA list, three UEFA Champions League matches have seen Dean in charge, while the Wirral-born referee officiated a further 31 matches in the UEFA Cup/Europa League.\n\nDean has enjoyed a successful international career too, which began when he officiated a friendly between Netherlands and Republic of Ireland in 2004. In addition, he has since taken charge of FIFA World Cup and UEFA European Championship qualifying matches. The Cheshire FA official stepped down from the FIFA international list at the end of 2013 at the mandatory retirement age of 45.\n\n', 4),
('Mike Jones', 'Mike Jones plied his trade as a Football League referee for 11 years before he was added to the Select Group in 2008 and began officiating in the Premier League.\n\nJones, who made his refereeing debut in August 1997 when Mansfield Town played host to Hull City in League 2, regularly officiated in the Football League during his tenure.\n\nHe made his first appearance at Wembley Stadium when he took control of the League 2 Play-off Final between Bristol Rovers and Shrewsbury Town in 2007. Then in 2009 he refereed the FA Trophy Final between Stevenage and York City.\n\nThe Cheshire FA referee has been the fourth official in numerous major domestic competition fixtures, including the 2004 League Cup Final, 2009/10 Championship Play-off Final, 2010 FA Community Shield and 2012 FA Cup Final.\n\nJones was in the middle for a Premier League match for the first time when Hull took on Wigan Athletic in August 2008. He has been a permanent fixture in the top-flight ever since, refereeing over 150 matches.', 12),
('Neil Swarbrick', 'After taking up refereeing at the age of 29, Neil Swarbrick was promoted to the National List of assistant referees within six years, and he has enjoyed a rapid rise up the officiating ranks since.\n\nSwarbrick learned his trade in the Northern Premier League and Conference before he joined the Football League in 2005.\n\nHe regularly officiated across the Football League for the next six years, as well as taking charge of FA Cup and League Cup matches during that period.\n\nHis first Premier League appointment came in December 2010, when he was in the middle for Fulham’s goalless draw with Sunderland.\n\nThe following season, the Lancashire FA official was promoted to the Select Group of referees and Swarbrick has since refereed more than 80 Premier League matches.\n\nSwarbrick was the referee for both legs of the 2013 FA Youth Cup Final between Chelsea and Norwich City, before taking up a fourth official role when Crystal Palace defeated Watford in the Championship Play-off Final later that year.\n\nThe Preston-born referee was fourth official at Wembley again in the 2013/14 season, when Manchester City beat Sunderland to lift the Capital One Cup.', 10),
('Paul Tierney', 'Paul Tierney was promoted to the Select Group of Referees alongside Stuart Attwell ahead of the 2015/16 season after a successful seven years on the National List.\n\nHis first experience of a Premier League match  in the middle came in the 2014/15 campaign when he was in charge of Swansea City versus West Bromwich Albion at the Liberty Stadium on 30 August 2014.\n\nTierney got a taste of officiating in the Premier League in the 2008/09 season when he was an assistant referee for the match at St. James\' Park between Newcastle United and Hull City.\n\nThe Lancashire FA official then became a member of the National Group of Referees ahead of the 2009/10 campaign, with Macclesfield Town against Notts County on the opening weekend of the League Two season being the first fixture he refereed.\n\nHis career highlights include taking charge of the 2014 League Two Play-off Semi-final second leg between Southend United and Burton Albion, and in the same season he officiated the Football League Trophy Southern Final second leg between Peterborough United and Swindon Town.\n\nTwo years later, Tierney was in the middle for another League Two Play-off Semi-final second leg - Plymouth Argyle versus Portsmouth.\n\nTierney also boasts two Wembley appearances on his CV as he was the assistant referee in Chelsea\'s 2009 FA Cup Semi-final victory over Arsenal, and the fourth official in the 2014 FA Vase Final between Sholing and West Auckland Town.', 16),
('Robert Madley', 'Robert Madley made his debut as a referee in the Premier League when he took charge of Southampton’s encounter with West Bromwich Albion in April 2013.\n\nThe West Yorkshire-based referee began officiating in 2002 and worked his way up to the Football League and professional cup competitions in the 2009/10 campaign, making his debut in the middle when Northampton Town took on Fleetwood Town in the FA Cup in November 2009.\n\nMadley oversaw matches predominantly in League One and League Two in the following two campaigns, but his first task of refereeing a top-flight team came when Everton hosted non-league Tamworth for the FA Cup Third Round tie in Janaury 2012.\n\nIn the 2012/13 season, Madley was regularly the man in the middle for matches in the Championship, as well as a selection of lower league, League Cup and FA Cup ties, and he made his top-flight debut at St Mary’s Stadium.\n\nSubsequently, he earned a spot in the Select Group of Premier League officials from the 2013/14 Premier League season.\n\nMadley was in charge of the first and second leg of the 2014/15 FA Youth Cup Final between Chelsea and Manchester City.\n\nThe West Riding FA official was added to the FIFA international list in January 2016 and he finished the 2015/16 campaign by refereeing Hull City versus Sheffield Wednesday in the Championship Play-off Final at Wembley Stadium.', 2),
('Roger East', 'Roger East joined the Select Group of officials in 2013 after a successful spell as a Football League referee.\n\nThe Wiltshire FA official, who has been on the National list since 2006, was an assistant referee at the 2004 FA Cup Final and 2006 FA Community Shield before stepping into the middle for the 2006/07 campaign.\n\nEast was in charge of Huddersfield Town\'s 2012 League One Play-off Final victory over Sheffield United at Wembley Stadium and in the following campaign, he oversaw his first Premier League match, when Swansea City and Sunderland battled out a 2-2 draw at the Liberty Stadium in September 2012.\n\nAfter impressing during the 2012/13 season, East earned a permanent spot in the Select Group of officials from the 2013/14 season and has now accumulated over 50 Premier League matches as a referee.', 15),
('Stuart Attwell', 'Stuart Attwell was promoted to the Select Group of referees for the 2016/17 season following consistent refereeing displays since returning as a National List official in 2012.\n\nThe Nuneaton-born official worked his way up through non-league football before refereeing in the Football League for the first time on 11 August 2007 for the League 2 fixture between Hereford United and Rotherham United.\n\nThroughout the 2007/08 season, Attwell officiated in League 2, League 1 and the Championship and was rewarded at the end of the season with the League 2 Play-Off Final between Stockport County and Rochdale, at Wembley Stadium.\n\nAfter just one season in the Football League, Attwell was included in the Select Group of officials for 2008/09  and became the youngest referee in Premier League history at 25 as he took charge of Blackburn Rovers’ 1-1 draw with Hull City in August 2008. This record has since been broken by Northumberland FA official Michael Oliver.\n\nAttwell was added to the FIFA international list of referees in 2009, taking charge of PSV Eindhoven v Hapoel Tel Aviv in the 2011/12 UEFA Europa League. He has been in charge of an UEFA Champions League qualifier and has also officiated international friendlies in Europe and Asia.\n\nIn February 2012, Attwell returned to Football League duty on the National List, including the 2012/13 League 1 Play-off Semi-final first leg match between Sheffield United and Yeovil Town.\n\nAttwell took charge of five Premier League matches over the next two seasons and in March 2016 it was announced the Birmingham FA official was to return to the Select Group.', 14);
